function changeAttribute(attribute, csvData){
	//change the expressed attribute
	//expressed = attribute;
	
	//recolor the map
	d3.selectAll(".community") //select every region
	.style("fill", function(d) { //color enumeration units
	return choropleth(d, colorScale(csvData)); //->
	});
	};

function highlight(data){
	
	var props = data.properties; //json properties
	
	d3.select("#"+props.EDPROV+props.EDNUMBER) //select the current region in the DOM
		.style("fill", "#bdbdbd"); //set the enumeration unit fill to black
	
	var labelAttribute = //"<h1>"+props[expressed]+
						 //"</h1><br><b>"+expressed+"</b>"; //label content
						 "<h1>" + props.EDNAME + "</h1>"; //label content
	var labelName = props.NAME; //html string for name to go in child div
	
	//create info label div
	var infolabel = d3.select("body").append("div")
		 .attr("class", "infolabel") //for styling label
		 .attr("id", props.EDPROV+props.EDNUMBER+"label") //for label div
		 .html(labelAttribute) //add text
		 //.append("div") //add child div for feature name
		 //.attr("class", "labelname") //for styling name
		 //.html(labelName); //add feature name to label
		;
		
};

function dehighlight(data){

	 //json or csv properties
	 var props = data.properties; //json properties
	 var ridings = d3.select("#"+props.EDPROV+props.EDNUMBER); //select the current region
	 var fillcolor = ridings.select("desc").text(); //access original color from desc
	 ridings.style("fill", fillcolor); //reset enumeration unit to original color
	 
	 d3.select("#"+props.EDPROV+props.EDNUMBER+"label").remove(); //remove info label
		
};

function moveLabel() {
	
	var x = d3.event.clientX+10; //horizontal label coordinate
	var y = d3.event.clientY-75; //vertical label coordinate

	d3.select(".infolabel") //select the label div for moving
		.style("margin-left", x+"px") //reposition label horizontal
		.style("margin-top", y+"px"); //reposition label vertical
};


						
